  render(){
    const imgSrc="https://www.google.co.kr/images/branding/googlelogo/1x/googlelogo_color_272x92dp.png";
    const divText="구글구글";
    return (
      <div>
        <img src={imgSrc}/>
        <div>이게 {divText} 입니다.</div>
        {/* 만든 컴포넌트를 추가 (.jsx 파일) */}
